import random;

################################################################################

def WeightedRandom(weightsByType : dict):
  sum = 0;

  for _, v in weightsByType.items():
    sum += v;

  target = random.randrange(1, sum);

  for k, v in weightsByType.items():
    if target <= v:
      return k;

    target = target - v;

  #
  # Shouldn't get here, but in any case.
  #
  begin = list( weightsByType.keys() )[0];

  return begin;

################################################################################

def PrefixOK(prefix : str) -> bool:
  ln = len(prefix);

  if ln < 2:
    return True;

  counter = 0;

  for i in range(ln):
    if prefix[i] in Consonants:
      counter += 1;

  allConsonants = (counter == ln);
  doubleConsonants = False;

  if not allConsonants:
    doubleConsonants = (prefix[0] == prefix[1]);

  return not (allConsonants or doubleConsonants);

################################################################################

def RemoveTripleLetters(string : str) -> str:
  while True:
    shouldPostProcess = False;

    lastLetter = string[0];

    duplicateCount = 1;

    toReplace = "";

    for i in range(1, len(string)):
      if string[i] == lastLetter:
        duplicateCount += 1;
      else:
        duplicateCount = 1;

      if duplicateCount >= 3:
        toReplace = string[i] * 3;
        shouldPostProcess = True;
        break;

      lastLetter = string[i];

    if not shouldPostProcess:
      break;

    string = string.replace(toReplace, toReplace[0]);

  return string;

################################################################################

def GetRank(string : str) -> float:
  cons = 0;
  vows = 0;

  for c in string:
    if c in Consonants:
      cons += 1;
    else:
      vows += 1;

  if cons == 0:
    cons = 1;

  return ( float(vows) / float(cons) );

